taskSetItem.script2:
var pageSize = eio.readInt32();
var pageCurrent = eio.readInt32();
var e1 = eio.readString16();
var e2 = eio.readInt32(); 
var e3 = eio.readInt32(); 
var e4 = eio.readInt32();
var e5 = eio.readInt32();
//var e4 = eio.readInt32();
//产生条件语句 where accountName='" + db.encode(session.get("username")) + "'
var condition = " where 1=1 ";

//if(e2!=1 & e3!=1){
  // condition +=" and feedBack.status = '教练申请未读'or feedBack.status = '教练申请已读'";
//}

if (e1!="") {
    condition += " and concat(userInfo.nickName,userInfo.mobile,status) like '%" + db.encode(e1) + "%'";
}

if (e2!=0) {
    condition += " and feedBack.status = '教练申请未读'";
}

if (e3!=0) {
    condition += " and feedBack.status = '教练申请已读'";
} 
if (e4!=0) {
    condition += " and feedBack.status = '未读'";
}  
if (e5!=0) {
    condition += " and feedBack.status = '已读'";
}
//if (e4!=0) {
  //  condition += " and feedBack.status = '提现失败'";
//}
var sql, sqlResult;

//获取记录数量
sql = "select count(*) as c from feedBack INNER JOIN userInfo ON feedBack.userId = userInfo.id " + condition; 
es.logWarning(sql); 
sqlResult = db.executeQuery("PJ", sql);
db.read(sqlResult);
var count = db.getInt32(sqlResult, "c");
//读取表
sql =
    "SELECT feedBack.id,userInfo.nickName,userInfo.mobile,feedBack.regDatetime,feedBack.status,feedBack.text,feedBack.reply " +//feedBack.id,userInfo.nickName,userInfo.mobile,feedBack.regDatetime,feedBack.status,feedBack.text 
    " FROM feedBack left JOIN userInfo ON feedBack.userId = userInfo.id" +
    condition + " order by regDatetime desc ";
es.logWarning(sql);                  
sqlResult = db.executeQuery("PJ", sql);
eio.appendInt32(count);
eio.appendDataSet(sqlResult, "id,nickName,mobile,regDatetime,status,text,reply", pageSize*(pageCurrent-1), pageSize);

